import React from "react";
import ReactDOM from "react-dom";

function MyFunc()
{
    return(   
    <div>
        <h1>Koppresh putpak</h1>
        <p>I'm ENgineering student</p>
        <ol>
            <li>Hi, I'm Kops</li>
            <li>I hope you are  having good time</li>
        </ol>
    </div>
    )
}

ReactDOM.render(
<MyFunc />,document.getElementById("root"));
